<script>

var metric = false;
var graphx = 800;
var graphy = 400;
var blend = 5; // number of points for moving averages
var elevSkip = blend; // reduce number of points sent to query
var textHeight = 12;
var axisWidth = 80;
var timeTick = 300;
var liftspeed = 5; // average lift speed in meters per second
var map_url = "http://worldwind27.arc.nasa.gov/wms/virtualearth?service=WMS&request=GetMap&version=1.1.1&srs=EPSG:4326&layers=ve&styles=&transparent=FALSE&format=image/png&width={width}&height={height}&bbox={w},{s},{e},{n}";

function plot_line(ctx, gLeft, gTop, gWidth, gHeight, mint, maxt, linesz, style, ar, varname, leftaxis, title)
{
	var len = ar.length;

	var min = max = ar[0][varname];
	for (point of ar) {
		if (point[varname] < min) min = point[varname];
		if (point[varname] > max) max = point[varname];
	}

	ctx.save();

	ctx.lineWidth = 1;
	ctx.strokeStyle = style;
	ctx.fillStyle = style;
	ctx.textAlign = "center";
	ctx.textBaseline = "middle";
	ctx.fillText(title, leftaxis ? (gLeft / 2) : (gLeft + gWidth + gLeft / 2), gTop / 2);
	ctx.textAlign = leftaxis ? "end" : "start";
	steps = 10;
	for (i = 0 ; i <= steps ; i++) {
		x = leftaxis ? gLeft : (gLeft + gWidth + 5);
		y = gTop + gHeight - gHeight * i / steps;
		ctx.beginPath();
		ctx.moveTo(x - 5, y);
		ctx.lineTo(x, y);
		ctx.stroke();
		value = Math.floor(min + i * (max - min) / steps);
		ctx.fillText(value, x + (leftaxis ? -10 : 5), y);
	}



	ctx.lineWidth = linesz;
	ctx.strokeStyle = style;
	ctx.beginPath();

	var first = true;
	for (point of ar) {
		x = gLeft + (point.time.getTime() - mint) * gWidth / (maxt - mint);
		y = gTop + gHeight - (point[varname] - min) * gHeight / (max - min);
		if (first) {
			ctx.moveTo(x, y);
			first = false;
		} else {
			ctx.lineTo(x, y);
		}
	}
	ctx.stroke();


	ctx.restore();
}

function setFontSize(ctx, sz)
{
	ctx.font = ctx.font.replace(/\d+px/, sz + "px");
}

function resizeFont(ctx, sz)
{
	ctx.font = ctx.font.replace(/\d+px/, (parseInt(ctx.font.match(/\d+px/)) + (sz)) + "px");
}

function plot(title, div, width, height, ar, var1, var2)
{
	graphdiv = document.getElementById(div);
	graphdiv.innerHTML = "";
	var canvas = document.createElement('canvas');	
	canvas.id = div+"-plot";
	canvas.width = width;
	canvas.height = height;
	graphdiv.appendChild(canvas);
	var ctx = canvas.getContext("2d");

	setFontSize(ctx, textHeight);
	gLeft = axisWidth;
	gTop = textHeight * 2;
	gWidth = width - 2 * axisWidth;
	gHeight = height - 4 * textHeight;

	ctx.save();
	ctx.lineWidth = 1;
	ctx.strokeStyle = "black";
	ctx.fillStyle = "black";
	ctx.textAlign = "center";
	ctx.textBaseline = "middle";

	resizeFont(ctx, 5);
	ctx.fillText(title, gLeft + gWidth / 2, gTop / 2);
	ctx.restore();

	var len = ar.length;
	var mint = timeTick * 1000 * Math.floor(ar[0].time.getTime() / (timeTick * 1000));
	var maxt = timeTick * 1000 * Math.floor(ar[len-1].time.getTime() / (timeTick * 1000)) + timeTick * 1000;
	
	plot_line(ctx, gLeft, gTop, gWidth, gHeight, mint, maxt, 2, "red", ar, var1, true, var1);
	if (var2) {
		plot_line(ctx, gLeft, gTop, gWidth, gHeight, mint, maxt, 2, "blue", ar, var2, false, var2);
	}

	ctx.lineWidth = "2";
	ctx.strokeStyle = "black";
	ctx.beginPath();
	ctx.rect(gLeft, gTop, gWidth, gHeight);
	ctx.stroke();

	ctx.lineWidth = "1";
	ctx.fillStyle = "black";
	ctx.textAlign = "center";
	ctx.textBaseline = "top";
	doption = { hour:"2-digit", minute:"2-digit", second:"2-digit", hour12:false};
	for (t = mint ; t <= maxt ; t += timeTick * 1000) {
		x = gLeft + gWidth * (t - mint) / (maxt - mint)
		y = gTop + gHeight;		
		showtime = false;
		showtick = 0;
		d = new Date(t);
		m = d.getMinutes();
		if (maxt - mint > 2 * 60 * 60 * 1000) {
			if (m == 0) showtime = true;
			if (m % 15 == 0) showtick = 8;
				else showtick = 4;
		} else {
			if (d.getMinutes() % 10 == 0) {
				showtime = true;
				showtick = 8;
			} else {
				showtick = 4;
			}
		}

		ctx.beginPath();
		ctx.moveTo(x, y);
		ctx.lineTo(x, y + showtick);
		ctx.stroke();

		if (showtime) {
			ctx.fillText(d.toLocaleTimeString(navigator.language, doption), x, y + 10);
		} 
	}	

}

function map_plot(bg, ctx, ar, width, height, minlat, maxlat, minlon, maxlon)
{
	ctx.save();

	if (bg) {
		ctx.drawImage(bg, 0, 0);
	} 

	for (lw = 4 ; lw >=2 ; lw -= 2) {
		ctx.lineWidth = lw;
		ctx.strokeStyle = (lw == 4) ? "white" : "black";
		ctx.beginPath();
		first = true;
		for (point of ar) {
			x = width * (point.lon - minlon) / (maxlon - minlon);
			y = height * (maxlat - point.lat) / (maxlat - minlat); // vertial direction opposite
			if (first) {
				ctx.moveTo(x, y);
				first = false;
			} else {
				ctx.lineTo(x, y);
			}

		}
		ctx.stroke();
	}
	ctx.restore();
}

function map(div, ar, width, height) 
{
	mapdiv = document.getElementById(div);
	mapdiv.innerHTML = "";
	var canvas = document.createElement('canvas');	
	canvas.id = div+"-map";
	canvas.width = width;
	canvas.height = height;
	mapdiv.appendChild(canvas);
	var ctx = canvas.getContext("2d");

	var minlat = maxlat = minlon = maxlon = 0;
	for (point of ar) {
		if (minlat == 0 && minlon == 0) {
			minlat = maxlat = point.lat;
			minlon = maxlon = point.lon;
		} else {
			if (point.lon < minlon) minlon = point.lon;
			if (point.lon > maxlon) maxlon = point.lon;
			if (point.lat < minlat) minlat = point.lat;
			if (point.lat > maxlat) maxlat = point.lat;
		}
	}
	map_padding = 0.001;
	minlon -= map_padding;
	maxlon += map_padding;
	minlat -= map_padding;
	maxlat += map_padding;
	map_plot(null, ctx, ar, width, height, minlat, maxlat, minlon, maxlon);

	var url = map_url;
	url = url.replace("{width}", width);
	url = url.replace("{height}", height);
	url = url.replace("{w}", minlon);
	url = url.replace("{e}", maxlon);
	url = url.replace("{s}", minlat);
	url = url.replace("{n}", maxlat);

	img = new Image;
	img.src = url;
	img.addEventListener('load', function() { map_plot(img, ctx, ar, width, height, minlat, maxlat, minlon, maxlon); } );

}

function elevProcess(elev, csv)
{
	elevCount = 0
	console.log(elev);
	for (i = 0 ; i < csv.length ; i++) {
		j = Math.floor(i / elevSkip);
		k = i % elevSkip;
		if (j >= elev.results.length - 1) {
			csv[i].elev = elev.results[elev.results.length - 1].elevation;
		} else {
			csv[i].elev = ((elevSkip - k) * elev.results[j].elevation + 
				(k) * elev.results[j+1].elevation ) / elevSkip;
		}
	}
	plot("Altitude Elevation Comparison", "test", graphx, graphy, csv, 
		"avgAlt", "elev");
}

function elevQuery(obj, csv)
{
	var data = JSON.stringify(obj);
	var xhr = new XMLHttpRequest();
	var url = "https://api.open-elevation.com/api/v1/lookup";
	xhr.open("POST", url, true);
	xhr.setRequestHeader("Content-Type", "application/json");
	xhr.onreadystatechange = function () {
		if (xhr.readyState === 4 && xhr.status === 200) {
			var json = JSON.parse(xhr.responseText);
			elevProcess(json, csv);
		}
	};
	xhr.send(data);	

}

function calcGC(lat1, lon1, lat2, lon2) {
    var R = 6378137; // avg radius of earth in meters
    var dLat = lat2 * Math.PI / 180 - lat1 * Math.PI / 180;
    var dLon = lon2 * Math.PI / 180 - lon1 * Math.PI / 180;
    var a = Math.sin(dLat/2) * Math.sin(dLat/2) +
    	Math.cos(lat1 * Math.PI / 180) * Math.cos(lat2 * Math.PI / 180) *
    	Math.sin(dLon/2) * Math.sin(dLon/2);
	return R * 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
}


function process()
{
	data = document.getElementById("data");
	tcx = document.getElementById("tcx");
	try {
		parser = new DOMParser();
		xml = parser.parseFromString(tcx.value,"text/xml");
	} catch (err) {
		data.value  = "Error parsing TCX XML.\n\n" + err.message;
		return;
	}

	try {
		TrainingCenterDatabase = xml.getElementsByTagName("TrainingCenterDatabase")[0];
		Activities = TrainingCenterDatabase.getElementsByTagName("Activities")[0];
		Activity = Activities.getElementsByTagName("Activity")[0];
		Lap = Activity.getElementsByTagName("Lap")[0];
		Track = Lap.getElementsByTagName("Track")[0];
	} catch (err) {
		data.value  = "Can't find trackpoint list.\n\n" + err.stack;
		return;
	}

	csv = [];
	points = Track.getElementsByTagName("Trackpoint");
	for (point of points) {
		try {
			t = new Date(Date.parse(point.getElementsByTagName("Time")[0].textContent));
			d = parseFloat(point.getElementsByTagName("DistanceMeters")[0].textContent);
			a = parseFloat(point.getElementsByTagName("AltitudeMeters")[0].textContent);
			p = point.getElementsByTagName("Position")[0];
			lat = parseFloat(p.getElementsByTagName("LatitudeDegrees")[0].textContent);
			lon = parseFloat(p.getElementsByTagName("LongitudeDegrees")[0].textContent);
		} catch (err) {
			continue;
		}
		len = csv.length;
		if (len > 0) {
			gc = calcGC(lat, lon, csv[len-1].lat, csv[len-1].lon)
		} else {
			gc = 0;
		}


		var avgV = vertV = avgAlt = 0;
		if (len > blend) {
			deltaT = (csv[len-1].time.getTime() - csv[len-blend].time.getTime()) / 1000;
			if (deltaT < 0.001) deltaT = 0.001;
			for (i = 1 ; i <= blend ; i++) {
				avgV += parseFloat(csv[len - i].gc);
				avgAlt += parseFloat(csv[len - i].alt) / blend;
			}
			avgV /= deltaT;
			vertV = (csv[len-1].alt - csv[len-blend].alt) / deltaT;
		}

		csv.push( { dist:d, time:t, alt:a, lat:lat, lon:lon, 
				avgV:avgV, vertV:vertV, gc:gc, avgAlt:avgAlt, 
				MPH:avgV * 2.23694, Feet:avgAlt * 3.28084,
				Meters:avgAlt, KPH:avgV * 3600 / 1000 } );
	}

	csv.splice(0, blend + 1);

	elevLookup = { locations:[] };
	elevCount = 0;
	output = "Time, Distance, Altitude, Latitude, Longitude, Average Velocity, Vertical Velocity, Great Circle\n";
	doption = { hour:"2-digit", minute:"2-digit", second:"2-digit", hour12:false, fractionalSecondDigits:3 };
	for (row of csv) {
		output += row.time.toLocaleTimeString(navigator.language, doption) + ", " + 
		row.dist + ", " + row.alt + ", " + row.lat + ", " + row.lon + ", " + 
		row.avgV + ", " + row.vertV + ", " + row.gc + "\n";
		if (elevCount++ % elevSkip == 0) {
			elevLookup.locations.push({latitude:row.lat, longitude:row.lon});
		}
	}
	elevQuery(elevLookup, csv);
	data.value = output;
	plot("Altitude / Speed Graph", "graph", graphx, graphy, csv, 
		metric?"Meters":"Feet", metric?"KPH":"MPH");
	map("map", csv, graphy, graphy); // 400 seems to be about the maximum size this server allows
}

</script>
